import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <h1>Welcome to Our Landing Page</h1>
      </header>
      <main>
        <section className="cta">
          <h2>Discover Amazing Features</h2>
          <p>Learn about our awesome product and its benefits.</p>
          <button>Get Started</button>
        </section>
      </main>
      <footer>
        <p>&copy; 2023 Landing Page</p>
      </footer>
    </div>
  );
}

export default App;
